import React from 'react';
import './App.css';
import EquipmentComponent from './Components/Equipment/EquipmentComponent';
import PackageSelector from './Components/PackageSelector';

function App() {
  return (
      <div className='w-screen h-screen overflow-hidden'>
          <header className='w-full h-[2rem] bg-black'>
              test
          </header>
          <div className="pb-3 h-fit">
              <div className="w-full h-3/5 bg-blue-300 flex justify-center items-center md:rounded-2xl max-md:space-x-2.5  p-2">
                  <EquipmentComponent component='Speaker'/>
                  <EquipmentComponent component='MovingHead'/>
                  <EquipmentComponent component='SpeakerWithBass'/>
                  <EquipmentComponent component='Booth'/>
                  <EquipmentComponent component='SpeakerWithBass'/>
                  <EquipmentComponent component='MovingHead'/>
                  <EquipmentComponent component='Speaker'/>
              </div>
              <div className="flex justify-center p-2 h-fit">
                  <PackageSelector title={'Standard'}/>
              </div>
          </div>

      </div>

  );
}

export default App;
